import avatar from "../../assets/avatar.jpg";
import {
  CommentIcon,
  EmojiIcon,
  LikeIcon,
  MoreIcon,
  SaveIcon,
  ShareIcon,
} from "../../assets/icons/icons";
import { db } from "../../utils/firebase";
import { createUser } from "../../firebase/createUser";
import "./Post.scss";
import { useState } from "react";

const imgLink =
  "https://images.unsplash.com/photo-1684276882621-a87a01d02464?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHx0b3BpYy1mZWVkfDE0fGJEbzQ4Y1Vod25ZfHxlbnwwfHx8fHw%3D&auto=format&fit=crop&w=900&q=60";

export const Post = ({username}) => {
  const [comment, setComment] = useState("");
  const handleSubmit = (e) => {
    e.preventDefault();
    createUser(db);
  };

  return (
    <div className="post">
      <div className="top">
        <div className="avatar-container">
          <img src={avatar} className="avatar" alt="profile-picture"></img>
        </div>
        <div className="username-container">
          <a href="#" className="username">
            vefa.ozlu
          </a>
        </div>
        <MoreIcon />
      </div>
      <div className="media-container">
        <img src={imgLink} className="media" alt="post"></img>
      </div>
      <div className="buttons-container">
        <LikeIcon />
        <CommentIcon />
        <ShareIcon />
        <span></span>
        <SaveIcon />
      </div>
      <div className="likes-container">
        <div className="liked-by-avatar">
          <a href="#">
            <img src={avatar} className="avatar" alt="profile-picture"></img>
          </a>
        </div>
        <div className="likes-text">
          Liked by <a href="#">vefa.ozlu</a> and <a href="#">432 others</a>
        </div>
      </div>
      <div className="content">
        <div className="text">
          <a href="#" className="post-user">
            vefa.ozlu
          </a>
          Consequat aute ipsum incididunt consequat non duis sunt excepteur ut
          elit consequat voluptate cupidatat...
        </div>
        <a href="#">more</a>
        <span></span>
        <a href="#">View all 21 comments</a>
      </div>
      <div className="shared-date">
        <a href="#">1 hour ago</a>
      </div>
      <div className="comment-container">
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            value={comment}
            onChange={(e) => setComment(e.target.value)}
          />
          <input type="submit" />
        </form>

        {/*         <EmojiIcon />
        <div className="input-container">
          <div className="placeholder">Add a comment...</div>
        </div>
        <a href="#">Post</a> */}
      </div>
    </div>
  );
};

function Posts({ posts }) {
  return (
    <div className="Posts">
      {posts.map((post, index) => (
        <div key={index}>{post}</div>
      ))}
    </div>
  );
}

export default Posts;
